import React from 'react';
import './OvensView.css'
import OvenItem from './OvenItem';

function mapOvenData(ovenData,setupData) {
    var mapO=new Map;
    mapO.set("Name",ovenData.Name);
    mapO.set("State",ovenData.State);
    mapO.set("State",ovenData.State);
}
const OvensView=({ovenData,setupData})=>{
    return(
        //TODO :in case of having several oven items in need to use map
        <div className="ovenItems" >
            <OvenItem ovenData={ovenData} setupData={setupData}/>
        </div>
    )
};

export default OvensView;
